VALUES
	(1,'Forgot Password','{{template config_path=\"design/email/header\"}}\r\n{{inlinecss file=\"email-inline.css\"}}\r\n\r\n<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n    <tr>\r\n        <td class=\"action-content\">\r\n            <h1>{{htmlescape var=$customer.name}},</h1>\r\n            <p>There was recently a request to change the password for your account.</p>\r\n            <p>If you requested this password change, please reset your password here:</p>\r\n            <table cellspacing=\"0\" cellpadding=\"0\" class=\"action-button\" >\r\n                <tr>\r\n                    <td>\r\n                        <a href=\"{{store url=\"customer/account/resetpassword/\" _query_id=$customer.id _query_token=$customer.rp_token}}\"><span>Reset Password</span></a>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n            <p>If you did not make this request, you can ignore this message and your password will remain the same.</p>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path=\"design/email/footer\"}}',NULL,2,'Password Reset Confirmation for {{var customer.name}}',NULL,NULL,'2015-11-28 18:12:48','2015-11-28 18:12:48','customer_password_forgot_email_template','{\"store url=\\\"\\\"\":\"Store Url\",\"var logo_url\":\"Email Logo Image Url\",\"var logo_alt\":\"Email Logo Image Alt\",\"htmlescape var=$customer.name\":\"Customer Name\",\"store url=\\\"customer/account/resetpassword/\\\" _query_id=$customer.id _query_token=$customer.rp_token\":\"Reset Password URL\"}'),
	(2,'Email Header','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Strict//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n    <meta name=\"viewport\" content=\"initial-scale=1.0, width=device-width\" />\r\n</head>\r\n<body>\r\n{{var non_inline_styles}}\r\n<!-- Begin wrapper table -->\r\n<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" id=\"background-table\">\r\n    <tr>\r\n        <td valign=\"top\" class=\"container-td\" align=\"center\">\r\n            <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" align=\"center\" class=\"container-table\">\r\n                <tr>\r\n                    <td>\r\n                        <table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" class=\"logo-container\">\r\n                            <tr>\r\n                                <td class=\"logo\">\r\n                                    <a href=\"{{store url=\"\"}}\">\r\n                                        <img\r\n                                            {{if logo_width}}\r\n                                            width=\"{{var logo_width}}\"\r\n                                            {{else}}\r\n                                            width=\"165\"\r\n                                            {{/if}}\r\n\r\n                                            {{if logo_height}}\r\n                                            height=\"{{var logo_height}}\"\r\n                                            {{else}}\r\n                                            height=\"48\"\r\n                                            {{/if}}\r\n\r\n                                            src=\"{{var logo_url}}\"\r\n                                            alt=\"{{var logo_alt}}\"\r\n                                            border=\"0\"/>\r\n                                    </a>\r\n                                </td>\r\n                            </tr>\r\n                        </table>\r\n                    </td>\r\n                </tr>\r\n                <tr>\r\n                    <td valign=\"top\" class=\"top-content\">\r\n                    <!-- Begin Content -->',NULL,1,'Email - Header',NULL,NULL,'2015-11-28 18:30:36','2015-11-28 18:30:36','design_email_header',NULL),
